import React, {useState} from 'react'

function Number(props){
    const [number, setNumber] = useState(6)
    return(
        <div>
            <div className="numbers">{number}</div>
            <button onClick={()=>{setNumber(number+1)}}> +</button>
            <button onClick={()=>{setNumber(number-1)}}> -</button>
        </div>
    )
}

export default Number
